import React from 'react';
import { Link } from 'react-router-dom';

const modules = [
  {
    id: 1,
    title: 'Guide des Poissons',
    description: 'Découvrez les différentes espèces de poissons et leurs caractéristiques.',
    image: '/images/fish-guide.jpg',
    link: '/fish-guide'
  },
  {
    id: 2,
    title: 'Techniques de Pêche',
    description: 'Apprenez les différentes techniques de pêche, du niveau débutant à expert.',
    image: '/images/fishing-techniques.jpg',
    link: '/catalog'
  },
  {
    id: 3,
    title: 'Météo & Conditions',
    description: 'Consultez les conditions météorologiques idéales pour la pêche.',
    image: '/images/weather.jpg',
    link: '/weather'
  }
];

function Home() {
  return (
    <div className="home-container">
      <div className="container py-5">
        <div className="text-center text-white mb-5">
          <h1 className="display-4 mb-3">PêcheMaster Pro</h1>
          <p className="lead">Votre guide complet pour devenir un expert de la pêche</p>
        </div>

        <div className="row">
          {modules.map((module) => (
            <div key={module.id} className="col-md-4 mb-4">
              <Link to={module.link} className="text-decoration-none">
                <div className="module-card">
                  <div className="module-image-container">
                    <img
                      src={module.image}
                      alt={module.title}
                      className="module-image"
                    />
                  </div>
                  <div className="module-content">
                    <h3 className="module-title">{module.title}</h3>
                    <p className="module-description">{module.description}</p>
                  </div>
                </div>
              </Link>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Home;
